import styled from 'styled-components';
function Homepage() {
  return (
   <StyledWrapper>
    <div>a</div>
    <div>b</div>
    <div>c</div>

    </StyledWrapper>
  );
}

const StyledWrapper = styled.div`
 height:100vh;
 display:grid;
 grid-template-columns:33%, 33%, 33% ;
 background: var(--mainbg);
 background-size: var(--mainbg-size);

`;

export default Homepage;
